  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Killcohook National
  Wildlife Refuge outlines Refuge accomplishments from January through April of 1954.
  The report begins by summarizing the weather conditions and water conditions during
  this period. Wildlife- including migratory birds, upland game birds, furbearers,
  predators, rodents, mammals, raptors, and fish- is also covered. The Refuge development
  and maintenance section discusses physical developments, plantings, and prescribed
  burning. Resource management is outlined; topics include fur harvesting and commercial
  fishing. A progress report on field investigations and applied research is also
  provided. The public relations section of the report describes Refuge visitors.
  N-R forms are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
